import React from 'react'; 
import Tilt from 'react-tilt'; 
import './Logo.css';
import brain1 from './brain1.jpg'; 
import brain2 from './brain2.png'; 
import brain3 from './brain3.png'; 
import brain4 from './brain4.jpg'; 



const Logo = () => {
    return (   
       <div  className='ma4 mt0 '>
          <Tilt className="Tilt br2 shadow-2 " options={{ max : 75 }} style={{ height: 250, width: 250 }} >
            <div className="Tilt-inner"> <img style={{padding:'5px'}} alt='brain Logo'src={brain1} /> </div>
          </Tilt>
       </div>
    );
}

export default Logo;
